/*************** Example 1 ****************************/
lv_img_dsc_t img_freenove;
void lv_img_freenove_init(void){
  lv_img_header_t header;
  header.always_zero = 0;
  header.w = 80;
  header.h = 80;
  header.cf = LV_IMG_CF_TRUE_COLOR;
  img_freenove.header = header;
  img_freenove.data_size = 6400 * LV_IMG_PX_SIZE_ALPHA_BYTE;
  img_freenove.data = img_freenove_map;
};

void lv_example_img_1(void){
    lv_img_freenove_init();
    lv_obj_t * img1 = lv_img_create(lv_scr_act());//Apply for an img variable
    lv_img_set_src(img1, &img_freenove);     //Add image information to img
    lv_obj_align(img1, LV_ALIGN_CENTER, 0, -20);  //It is displayed 20 pixels above the middle of the screen
    lv_obj_set_size(img1, 80, 80);              //Set the size of the image

    lv_obj_t * img2 = lv_img_create(lv_scr_act());
    lv_img_set_src(img2, LV_SYMBOL_OK "Accept");  
    lv_obj_align_to(img2, img1, LV_ALIGN_OUT_BOTTOM_MID, 0, 20);//img2 is displayed 20 pixels below img1
}

/*************** Example 2 ****************************/
static lv_obj_t * red_slider, * green_slider, * blue_slider, * intense_slider;
static lv_obj_t * img1;

static void slider_event_cb(lv_event_t * e){
    LV_UNUSED(e);
    /*Recolor the image based on the sliders' values*/
    lv_color_t color  = lv_color_make(lv_slider_get_value(red_slider), lv_slider_get_value(green_slider),lv_slider_get_value(blue_slider));
    lv_opa_t intense = lv_slider_get_value(intense_slider);
    lv_obj_set_style_img_recolor_opa(img1, intense, 0);
    lv_obj_set_style_img_recolor(img1, color, 0);
}

static lv_obj_t * create_slider(lv_color_t color){
    lv_obj_t * slider = lv_slider_create(lv_scr_act());
    lv_slider_set_range(slider, 0, 255);
    lv_obj_set_size(slider, 10, 200);
    lv_obj_set_style_bg_color(slider, color, LV_PART_KNOB);
    lv_obj_set_style_bg_color(slider, lv_color_darken(color, LV_OPA_40), LV_PART_INDICATOR);
    lv_obj_add_event_cb(slider, slider_event_cb, LV_EVENT_VALUE_CHANGED, NULL);
    return slider;
}

//Demonstrate runtime image re-coloring
void lv_example_img_2(void){
    /*Create 4 sliders to adjust RGB color and re-color intensity*/
    red_slider = create_slider(lv_palette_main(LV_PALETTE_RED));
    green_slider = create_slider(lv_palette_main(LV_PALETTE_GREEN));
    blue_slider = create_slider(lv_palette_main(LV_PALETTE_BLUE));
    intense_slider = create_slider(lv_palette_main(LV_PALETTE_GREY));

    lv_slider_set_value(red_slider, LV_OPA_20, LV_ANIM_OFF);
    lv_slider_set_value(green_slider, LV_OPA_90, LV_ANIM_OFF);
    lv_slider_set_value(blue_slider, LV_OPA_60, LV_ANIM_OFF);
    lv_slider_set_value(intense_slider, LV_OPA_50, LV_ANIM_OFF);

    lv_obj_align(red_slider, LV_ALIGN_LEFT_MID, 20, 0);
    lv_obj_align_to(green_slider, red_slider, LV_ALIGN_OUT_RIGHT_MID, 20, 0);
    lv_obj_align_to(blue_slider, green_slider, LV_ALIGN_OUT_RIGHT_MID, 20, 0);
    lv_obj_align_to(intense_slider, blue_slider, LV_ALIGN_OUT_RIGHT_MID, 20, 0);

    /*Now create the actual image*/
    lv_img_freenove_init();
    img1 = lv_img_create(lv_scr_act());
    lv_img_set_src(img1, &img_freenove);
    lv_obj_align_to(img1, intense_slider, LV_ALIGN_OUT_RIGHT_MID, 20, 0);
    lv_event_send(intense_slider, LV_EVENT_VALUE_CHANGED, NULL);
}

/*************** Example 3 ****************************/
static void set_angle(void * img, int32_t v){
    lv_img_set_angle((lv_obj_t*)img, v);
}

static void set_zoom(void * img, int32_t v){
    lv_img_set_zoom((lv_obj_t*)img, v);
}

//Show transformations (zoom and rotation) using a pivot point.
void lv_example_img_3(void){
    lv_img_freenove_init();
    /*Now create the actual image*/
    lv_obj_t * img = lv_img_create(lv_scr_act());
    lv_img_set_src(img, &img_freenove);
    lv_obj_align(img, LV_ALIGN_CENTER, 0, 0);
    lv_img_set_pivot(img, 0, 0);    /*Rotate around the top left corner*/

    lv_anim_t a;
    lv_anim_init(&a);
    lv_anim_set_var(&a, img);
    lv_anim_set_time(&a, 3000);         //Animation execution time
    lv_anim_set_playback_time(&a, 3000);//Animation playback time
    lv_anim_set_repeat_count(&a, LV_ANIM_REPEAT_INFINITE);//Repetitive animation

    lv_anim_set_exec_cb(&a, set_angle); //Sets the animation callback function
    lv_anim_set_values(&a, 0, 3600);    //Sets the parameter range of the callback function
    lv_anim_start(&a);                  //Start animation

    lv_anim_set_exec_cb(&a, set_zoom);  //Sets the animation callback function
    lv_anim_set_values(&a, 128, 512);   //Sets the parameter range of the callback function
    lv_anim_start(&a);                  //Start animation
}


